import React from 'react'
import StoryMetadataBtn from './StoryMetadataBtn'

const StoryFilter = props => {
  const { filterTags, toggleFilter } = props
  return (
    <div>
      <div className='website-tags'>
        {
          filterTags.websites.map(website => {
            <StoryMetadataBtn 
              website={website}
            />

          })

        }

      </div>
      <div className='category-tags'>
        <StoryMetadataBtn />
      </div>
    </div>
  )
}

export default StoryFilter
